import styled from 'styled-components';


export const NavigationBar = styled.nav`
 font-family: 'Lato', sans-serif;

  position: absolute;
  top: 0;
  display: inline-block;
  width: 100%;
  height: 20%;
  
`;

export const HomeText = styled.div`
  display: inline-block;

  font-size: 3.3em;
  color: white;
  margin-left: 10%;
  margin-top: 0;
 

`;

export const Ul = styled.ul`
  display: inline-block;
  width: 20%;
  height: 15%;
  float: right;
  margin-right: 4%;
`;

export const Li = styled.li`
  display: inline-block;
  color: white;
  padding: 20px;
`;

export const SearchLiImage = styled.li`
  padding: 20px;
  display: inline-block;
color: white;
  width: 100px;
  height: 100px;
`;
